import React, { useState } from "react";
import { Link, NavLink } from "react-router-dom";

function NavBar() {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  return (
    <div className="navWrapper">
      <div className="burger" id="burger" onClick={toggleMenu}>
        <div className="bar"></div>
        <div className="bar"></div>
        <div className="bar"></div>
      </div>
      <div className="logo">
        <Link to="/">My Bonsai Garden</Link>
      </div>
      <div className={`navigation ${isMenuOpen ? "show" : ""}`}>
        <NavLink to="/" activeClassName="active_link" exact>
          Home
        </NavLink>
        <NavLink to="/about" activeClassName="active_link">
          About
        </NavLink>
        <NavLink to="/bonsaicollection" activeClassName="active_link">
          Bonsai Collection
        </NavLink>
        <NavLink to="/addbonsai" activeClassName="active_link">
          Add a Bonsai
        </NavLink>
      </div>
    </div>
  );
}

export default NavBar;
